import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import PrmNavBar from "./PrmNavBar";
import PrmCardList from "./PrmCardList";
import logo from "./assets/images/logo-conti.png";

class Home extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div class="prm-background">
        <PrmNavBar></PrmNavBar>
        <div class ="team-description">
          <p class ="p-title">Problem Resolution Managementâ€‹ & Configuration Management</p> 
          <p class ="p-location">Iasi</p> 
        </div>
        <PrmCardList></PrmCardList>
        <div>
            <div class="projects-list">SYSHADHA10, SYSHADHA22, ADC420HA10, ADC420HA22, CEM200, LSM030VW11, ADC424VW11, RVS2xxVW11, RVS231DP10</div>
            <img src={logo}  class="logo-conti"  />
        </div>
      </div>
    );
  }
}

export default Home;
